const styles = (theme) => ({
  lossInfoTitle: {
    borderBottom: 0,
    marginBottom: 0,
    paddingBottom: 0,
    paddingLeft: 32
  },
  lossTime: {
    marginTop: 20
  },
  datepicker: {
    '& > div': {
      color: theme.palette.neutral.dark,
    },
  },
  catCodeSelect: {
    '& .MuiBox-root': {
      overflow: 'hidden',
    },
  },
  icon: {
    flex: '0 1 auto',
    marginRight: 4,
    marginLeft: -2,
    fontSize: theme.typography.pxToRem(32),
    color: theme.palette.primary.main,

    '& > svg': {
      display: 'block',
    },
  },
  title: {
    fontSize: theme.typography.pxToRem(13),
    fontWeight: theme.typography.fontWeightMedium,
  },
  gridFlex: {
    display: 'flex',
  },
  header: {
    display: 'flex',
    alignItems: 'center',
    maxWidth: '100%',
    padding: '0 !important',
  },
});

export default styles;
